import './App.css';
import React from 'react'; //we should import jsx, react is library from node modules
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import classes from "./components/Navbar/Navbar.module.css";


const App = (props) => {
    return (
        <BrowserRouter>
            <div className='app-wrapper'>
                <Header/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Routes>
                        <Route path = {"/profile"} element={<Profile posts = {props.posts}/>} />
                        {/* element={<Dialogs dialogs={dialogs} messages={messages}/>} />  + объявление самих массивов */}
                        {/* props as attribute */}
                        <Route path = {"/dialogs"} element = {<Dialogs dialogs={props.dialogs} messages={props.mess} />} />
                        {/*<Route path = {"/news"} element = {<New />} /> NO NEED TO WRITE EXACT PATH*/}
                        {/*<Route path = {"/music"} element = {<Music />} />*/}
                        {/*<Route path = {"/settings"} element = {<Settings />} />*/}
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
